  mydataValues = mydata.chart.result[0].indicators.quote[0];

  open = mydataValues.open.slice(0, 200);
  close = mydataValues.close.slice(0, 200);
  high = mydataValues.high.slice(0, 200);
  low = mydataValues.low.slice(0, 200);

  dates = mydata.chart.result[0].timestamp.slice(0, 200);

  parser = d3.utcParse("%s");

  dates = dates.map(date => parser(date));

  const margin = {top: 30, right: 65, bottom: 205, left: 50},
             w = 1800 - margin.left - margin.right,
             h = 625 - margin.top - margin.bottom;

  var svg = d3
    .select("#container")
    .attr("width", w + margin.left + margin.right)
    .attr("height", h + margin.top + margin.bottom)
    .append("g")
    .attr("transform", "translate(" +margin.left+ "," +margin.top+ ")");

  var xScaleUtc = d3
    .scaleUtc()
    .domain(d3.extent(dates, d => d))
    .range([0, w]);

  var xScale = d3
    .scaleLinear()
    .domain([0, dates.length])
    .range([0, w]);

  var xScaleBand = xScale(1) - xScale(0);

  let xBand = d3
    .scaleBand()
    .domain(d3.range(0, data.length))
    .range([0, w])
    .padding(0.3);

  var xAxisTop = d3.axisBottom()
    .scale(xScaleUtc)
    .ticks(20, "%x");

  var gXTop = svg
    .append("g")
    .attr("class", "axis x-axis") //Assign "axis" class
    .attr("transform", "translate(0," + h + ")")
    .call(xAxisTop);

  var yScale = d3
    .scaleLog()
    .domain([d3.min(low), d3.max(high)])
    .range([h, 0]);

  var yAxis = d3.axisLeft()
    .scale(yScale)
//    .tickValues([12, 18, 27])
//    .tickFormat(d3.format("$"));
    .ticks(10, "$");

  var gY = svg
    .append("g")
    .attr("class", "axis y-axis")
    .call(yAxis);

  svg
    .append("g")
    .attr("class", "axis y-axis foobar")
    .call(yAxis.tickSize(-w).tickFormat(""))

  d3
    .selectAll(".foobar")
    .style("color", "#00000055");

  svg
    .selectAll(".line")
    .data(dates)
    .enter()
    .append("line")
    .attr("class", "line")
    .attr('x1', (d, i) => xScale(i) + (xScaleBand * 0.7 / 2))
    .attr('y1', (d, i) => yScale(high[i]))
    .attr('x2', (d, i) => xScale(i) + (xScaleBand * 0.7 / 2))
    .attr('y2', (d, i) => yScale(low[i]))
    .attr("stroke", "black")
    .attr("stroke-width", 1.5);

  let candles = svg
    .selectAll(".candle")
    .data(dates)
    .enter()
    .append("rect")
    .attr("class", "candle")
    .attr('x', (d, i) => xScale(i))
    // .attr('y', (d, i) => yScale(open[i]))
    .attr('y', (d, i) => open[i] > close[i] ? yScale(open[i]) : yScale(close[i]))
    .attr('width', (d, i) => xScaleBand * 0.7)
    .attr('height', (d, i) => Math.abs(yScale(open[i]) - yScale(close[i])))
    .attr('fill', (d, i) => open[i] > close[i] ? "red" : "green");

  const extent = [[0, 0], [w, h]];
    
  var resizeTimer;
  var zoom = d3.zoom()
    .scaleExtent([1, 50])
    .translateExtent(extent)
    .extent(extent)
    .on("zoom", zoomed);
    //.on('zoom.end', zoomend);

  d3
    .select("#container")
    .call(zoom)


  function zoomed(event) {

//    var xAxisTop = d3.axisBottom()
//      .scale(xScaleUtc);

    var t = event.transform;
    let xScaleZ = t
      .rescaleX(xScale)
      .range([0, w].map(d => event.transform.applyX(d)));

    //xScale.range([0, w].map(d => event.transform.applyX(d)));
    //xScaleBand = xScale(1) - xScale(0);
    let xScaleZBand = xScaleZ(1) - xScaleZ(0);

    // let xScaleUtcRes = t.rescaleX(xScaleUtc);
    //xScaleUtc
    //  .range([0, w].map(d => event.transform.applyX(d)));

    svg
      .selectAll(".candle")
      .attr("x", (d, i) => xScaleZ(i))
      .attr("width", xScaleZBand * 0.7);
    svg
      .selectAll(".line")
      .attr('x1', (d, i) => xScaleZ(i) + (xScaleZBand * 0.7 / 2))
      .attr('x2', (d, i) => xScaleZ(i) + (xScaleZBand * 0.7 / 2));


    // svg.selectAll(".x-axis").call(xAxisTop);

    svg
      .selectAll(".x-axis")
      .call(
        d3.axisBottom()
          .scale(
            t
              .rescaleX(xScaleUtc)
              .range([0, w].map(d => event.transform.applyX(d)))
          )
          .ticks(20, "%d-%m-%Y")
      );

  }
